import React, { Component } from "react";
import { Form } from 'protected-aidaforms';
import json from './InitialEvaluation.js';
import UtenteDataService from "C:/Users/ines_/fisiosys/frontend/src/services/tutorial.service.js";

export default class Avininum extends Component {
  constructor(props) {
    super(props);
    this.onChangeSearchnome_utente = this.onChangeSearchnome_utente.bind(this);
    this.retrieveUtente = this.retrieveUtente.bind(this);
    this.refreshList = this.refreshList.bind(this);
    this.setActiveUtente = this.setActiveUtente.bind(this);
    this.removeAllUtente = this.removeAllUtente.bind(this);
    this.searchnome_utente = this.searchnome_utente.bind(this);

    this.state = {
      Utente: [],
      currentUtente: null,
      currentIndex: -1,
      searchnome_utente: ""
    };
  }

  componentDidMount() {
    this.retrieveUtente();
  }

  onChangeSearchnome_utente(e) {
    const searchnome_utente = e.target.value;

    this.setState({
      searchnome_utente: searchnome_utente
    });
  }

  retrieveUtente() {
    UtenteDataService.getAll()
      .then(response => {
        this.setState({
          Utente: response.data
        });
        console.log(response.data);
      })
      .catch(e => {
        console.log(e);
      });
  }

  refreshList() {
    this.retrieveUtente();
    this.setState({
      Utente: null,
      currentIndex: -1
    });
  }

  setActiveUtente(Utente, index) {
    this.setState({
      Utente: Utente,
      currentIndex: index
    });
  }

  removeAllUtente() {
    UtenteDataService.deleteAll()
      .then(response => {
        console.log(response.data);
        this.refreshList();
      })
      .catch(e => {
        console.log(e);
      });
  }

  searchnome_utente() {
    this.setState({
      Utente: null,
      currentIndex: -1
    });

    UtenteDataService.findBynome_utente(this.state.searchnome_utente)
      .then(response => {
        this.setState({
          Utente: response.data
        });
        console.log(response.data);
      })
      .catch(e => {
        console.log(e);
      });
  }

  render() {
    const {  Utente } = this.state;
  
  return (
    <Form
      onSubmit={(values, changedFields) => console.log("SUBMITTED VALUES: ", values, "CHANGED FIELDS: ", changedFields)}
      onSave={(values, changedFields) => console.log("SAVED VALUES: ", values, "CHANGED FIELDS: ", changedFields)}
      onCancel={status => console.log("CANCELLED:", status)}
      template={json}
      dlm={{}}
      showPrint={true}
      editMode={true}
      professionalTasks={["Registar Pedido", "Consultar Pedido", "Anular Pedido"]}
      canSubmit={true}
      canSave={true}
      canCancel={true}
      patientData={{
        "numSequencial": Utente.num_sequencial,
        "episodio": 21016848,
        "modulo": "INT",
        "processo": 99998888,
        "nome": Utente.nome,
        "dtaNascimento": Utente.data_nascimento,
        "idade": 77,
        "sexo": "Masculino"
      }}
      reportData={{
        dtaEncerrada: "22-05-2019 13:02",
        dtaCriada: "10-05-2019 18:47",
        realizada: "Joana Pascoal",
        responsavel: "José Costa"
      }}
      referenceModel={[
        {
          "itemName": "Número mecanográfico",
          "item": "num_mecanografico",
          "value": "123456",
          "formVisible": true
        },
        {
          "itemName": "Número sequencial",
          "item": "num_seq",
          "value": Utente.num_sequencial,
          "formVisible": true
        },
        {
          "itemName": "Nome",
          "item": "Nome",
          "value": Utente.nome_utente,
          "formVisible": true
        }
      ]}
      submitButtonDisabled={false}
      saveButtonDisabled={false}
    />
  );
}
}
